import './App.css';
import Navbar from './components/Navbar'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import {ScrollConatainer, ScrollPage, Animator, batch, Sticky, Fade, MoveOut} from 'react-scroll-motion'

function App() {
  return (


      <Router>
        <Navbar /> 
        <Routes>
          <Route path="/" />
          <Route path="/products" />
          <Route path="/contact" />
          <Route path="/about" />
        </Routes>
      </Router>

  );
}

export default App;
